CREATE VIEW public.active_organism_by_available_certification_based_on_formacode AS
 SELECT DISTINCT org.id AS organism_id,
    cer.id AS certification_id,
    cer.searchable_text AS certification_searchable_text
   FROM public.certification cer,
    (public.organism org
     LEFT JOIN public.maison_mere_aap mma ON ((org.maison_mere_aap_id = mma.id))),
    public.formacode code,
    public.organism_on_formacode org_code,
    public.certification_on_formacode cer_code,
    public.organism_on_degree org_degree,
    public.degree degree
  WHERE (((org.typology = 'expertFiliere'::public."OrganismTypology") OR (org.typology = 'expertBrancheEtFiliere'::public."OrganismTypology")) AND (code.type = 'SUB_DOMAIN'::public."FormacodeType") AND (mma.is_active = true) AND (org.ferme_pour_absence_ou_conges = false) AND (cer.visible = true) AND (org_code.organism_id = org.id) AND (org_code.formacode_id = code.id) AND (cer_code.certification_id = cer.id) AND (cer_code.formacode_id = code.id) AND (org_degree.organism_id = org.id) AND (org_degree.degree_id = degree.id) AND (degree.level = cer.level) AND (NOT (EXISTS ( SELECT certification_on_ccn.certification_id
           FROM public.certification_on_ccn
          WHERE (certification_on_ccn.certification_id = cer.id)))))
UNION
 SELECT DISTINCT org.id AS organism_id,
    cer.id AS certification_id,
    cer.searchable_text AS certification_searchable_text
   FROM public.certification cer,
    (public.organism org
     LEFT JOIN public.maison_mere_aap mma ON ((org.maison_mere_aap_id = mma.id))),
    public.convention_collective ccn,
    public.organism_on_ccn org_ccn,
    public.certification_on_ccn cer_ccn,
    public.organism_on_degree org_degree,
    public.degree degree
  WHERE (((org.typology = 'expertBranche'::public."OrganismTypology") OR (org.typology = 'expertBrancheEtFiliere'::public."OrganismTypology")) AND (mma.is_active = true) AND (org.ferme_pour_absence_ou_conges = false) AND (cer.visible = true) AND (org_ccn.organism_id = org.id) AND (org_ccn.ccn_id = ccn.id) AND (cer_ccn.certification_id = cer.id) AND (cer_ccn.ccn_id = ccn.id) AND (org_degree.organism_id = org.id) AND (org_degree.degree_id = degree.id) AND (degree.level = cer.level));


