INSERT INTO public.certification_authority_structure VALUES ('b31f0e94-0b18-4301-953b-b2f3132086b7', 'Deleniti vigilo terebro creber dedecor demitto artificiose apud cauda calamitas.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('abd60fe4-1123-41da-b8ec-e41525ca5166', 'Vereor admiratio sui amor via.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('0c41c570-a4ff-4e84-b8e3-e86203857da7', 'Anser dolorum abscido tabernus paulatim crepusculum.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('3f88498b-eb2d-4ac1-944b-fb2046d14a0b', 'Dolorum deripio tametsi sumptus.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('46abefe8-258c-4108-9ec6-2be27da6b4c2', 'Infit caries tepidus animi.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('732e73f3-c74d-407e-8a7a-71ab0d2da51d', 'Certus viduo arca thesis arto nulla attero.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('f37b0c48-3a4a-45cd-857e-e3234dabf7c1', 'Vulticulus cunabula creber titulus vito tutamen tolero infit sollicito.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('29f2e208-5c34-44b2-a794-2ebeff82abaf', 'Colligo allatus molestias sequi tumultus deserunt deleniti sustineo adulescens.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('67acf35a-9ec6-4487-90d8-e0440c1747a7', 'Debitis vetus mollitia vulariter.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('bfbaf39b-6483-4f08-bf30-6dc4fbdfac0b', 'Vinco tendo aeger deleo corroboro volubilis commemoro vaco magni harum.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('6bbea069-fddf-452a-9a53-8772a89c6be7', 'Vomito concido rem caute vulticulus recusandae auditor crinis aetas.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('6c4fc52b-46d5-4beb-9a4f-80dc7681b402', 'Arma eveniet tactus desidero adipisci tenetur advenio molestias.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('c833de89-a475-4659-99e3-d02b725c2fe5', 'Admoveo vulgivagus utpote atqui.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('f82161c6-409b-4858-87cc-dc086adf8d24', 'Comptus ipsum textilis in tendo summopere aperio.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('fa62bb3d-480d-42ad-9327-d1194668d0a8', 'Vicissitudo constans patrocinor benevolentia.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('9675f398-8cd2-471d-b9c6-293f8aa1a03e', 'Ancilla sint cura.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('ac3a0ad0-1dba-4b00-aa22-5326069044ca', 'Adstringo tenetur adversus confugo sol acervus ullam victus illum commemoro.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('996e13b4-9a7a-4ffa-85cd-b594c5967aa0', 'Certus solium trepide paulatim suasoria centum coniuratio.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('a80f5f22-0a20-4236-bc24-944896f62601', 'Inflammatio distinctio abduco tempore dedico contabesco admitto territo villa assumenda.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('0f5de20e-c096-494c-9258-94e7e5ee0316', 'Auxilium cuius compono tenetur laboriosam certus.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('b4bf93bf-9e49-42e9-a120-1a254e6a5567', 'Suspendo deduco complectus super aduro pauper defluo.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('89c31745-77ef-4cb8-8994-4515c2f3bba5', 'Distinctio acquiro vergo ustilo calco libero tremo.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('566abb4b-b681-4464-ad1f-0bc662a314b9', 'Quas sapiente aveho hic eveniet pauci non tabula.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('55e2d326-d664-4329-8d3f-a746ffaeee0f', 'Velum vinco cognatus tremo abundans.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('db2037c2-0e83-40de-a990-9960bd4e427c', 'Alienus coniecto comitatus quasi territo spiritus solium audio aequitas arbor.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('cf4e0a93-d0dd-4e1e-be93-e4eb51e87ba4', 'Crastinus vallum sapiente auctus quia adnuo accendo textilis doloremque.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('38e9cc6c-6df2-4aeb-b68c-e978d9ceaadd', 'Cornu congregatio calculus aeneus error tibi adipisci vivo spoliatio admiratio.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('8b679459-b0cb-45b8-b6c7-b6f19490c480', 'Conforto totam defaeco occaecati uberrime coadunatio acsi.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('802e3135-929f-4ae1-80fa-d11e4e3b9133', 'Vacuus magni totam deporto bibo.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('d235c694-7d8f-4c3d-a778-d700ae0aefb2', 'Vomito decretum nisi impedit.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('6d93fb50-6522-4147-b224-8915ff077d30', 'Quod clam adulescens adimpleo cultura auctus decimus comptus.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('769d7a29-8f4d-432d-b863-4d136ddc6bdc', 'Curis spectaculum abbas amplus arceo tredecim pectus vilitas bestia atrox.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('2e6faa2f-40de-4cb3-84ed-e4a387ce3feb', 'Est omnis alius videlicet.', NULL, NULL, true);
INSERT INTO public.certification_authority_structure VALUES ('f67afd0e-53a3-45b0-b966-ac204db13471', 'Nostrum derideo coaegresco velit cresco accommodo aveho deprimo ullus.', NULL, NULL, true);
